import { UserProviderHooks } from "./ContextHooks";

const CompnentOneHooks = () => {
    // Render CompTwo with the context provider
    return (
      <UserProviderHooks value={'Welcome from Component One'} >
         <div>
      {/* <h2>Component One</h2> */}
       <CompnentFiveHooks/> 
        </div>     
    </UserProviderHooks>
    );
  };

  export default CompnentOneHooks;
